pragma solidity ^0.8.0;

import "node_modules/@openzeppelin/contracts/access/Ownable.sol";

struct TweethRepresentation {
        bytes text;
        bytes media_url;
        uint160 author;
        uint parentTweeth;
        uint timestamp;
        uint likes;
        uint comments;
        uint shares;
    }

interface TwetherPost{
    function getComments(uint tweethId) external view returns (uint[] memory);
    function getLikes(uint tweethId) external view returns (uint160[] memory);
    function getTweethAuthor(uint tweethId) external view returns(uint160);
    function getTweeth(uint tweethId) external view returns(TweethRepresentation memory);
    function totalSupply() external view returns (uint);

}

interface TwetherProfile{
    function getLikesByProfile(address user) external view returns (uint[] memory);
    function getFollowing(address user) external view returns (uint160[] memory);
    function getFollowers(address user) external view returns (uint160[] memory);
    function getMentions(address user) external view returns (uint[] memory);
    function getProfile(address _address) external view returns (bytes32 , bytes memory, bytes memory);
    function totalSupply() external view returns (uint);
    function getTweethsPerPage(address user, uint page) external view returns (uint[] memory);
    function getLast100Tweeths(address user) external view returns (uint[] memory);
    function getLast10Tweeths(address user) external view returns (uint[] memory);
    function getLastXTweeths(address user, uint8 amount) external view returns (uint[] memory);
}

contract TwetherAnalytics is Ownable {

    TwetherPost Post;
    TwetherProfile Profile;
    uint16 feedSize = 500;
    uint8 depthFactor = 2;

    function setPost(address _address) external onlyOwner {
        Post = TwetherPost(_address);
    }

    function setProfile(address _address) external onlyOwner {
        Profile = TwetherProfile(_address);
    }

    function setFeedSize(uint16 _feedSize) external onlyOwner {
        feedSize = _feedSize;
    }

    function setFeedSize(uint8 _depthFactor) external onlyOwner {
        depthFactor = _depthFactor;
    }

    function getLikesFromProfile(address user) external view returns (uint[] memory){
        return Profile.getLikesByProfile(user);
    }

    function getTweethLikes(uint tweethId) external view returns (uint160[] memory){
        return Post.getLikes(tweethId);
    }

    function getTweethComments(uint tweethId) external view returns (uint[] memory){
        return Post.getComments(tweethId);
    }

    function getProfileFollowing(address user) external view returns (uint160[] memory){
        return Profile.getFollowing(user);
    }

    function getProfileFollowers(address user) external view returns (uint160[] memory){
        return Profile.getFollowers(user) ;
    }

    function getProfile(address _address) external view returns (bytes32 , bytes memory, bytes memory){
        return Profile.getProfile(_address);
    }

    function getTweeth(uint tweethId) external view returns(TweethRepresentation memory){
        return Post.getTweeth(tweethId);
    }

    function getMentions(address user) external view returns (uint[] memory){
        return Profile.getMentions(user);
    }

    function getFeed(address user) external view returns(uint[] memory){
        uint160[] memory following = Profile.getFollowing(user);
        //How many feed pages I need to show 1 post of each person the user is following (*100)
        uint followingToFeedSize = (following.length * 100)/ feedSize;
        //when I need less than 2 pages to show at least 1 post from all of people the user is following
        //then maxDepth will be 10. It will decrease in 1 for every 2 xtra pages I need. The lowest depth
        //will be 3
        uint8 maxDepth = followingToFeedSize/(100*2) > 17 ? uint8(20 - followingToFeedSize/(100 * 2)) : uint8(3);
        //uint8 maxDepth = 1;
        // uint oldest = (Profile.totalSupply() * maxDepth * depthFactor * 2) < Post.totalSupply() ?
        //                     Post.totalSupply() - (Profile.totalSupply() * maxDepth * depthFactor * 2) : 0;
        //uint[feedSize] memory feed;
        uint[] memory tempFeed = new uint[](following.length * maxDepth * depthFactor);
        uint profileIndex = 0;
        uint lastCursor = 0;
        while(following.length > profileIndex){
            uint[] memory tweeths = Profile.getLastXTweeths(address(following[profileIndex]), maxDepth * depthFactor);
            uint8 i=0;
            uint8 j=0;
            uint total = tweeths.length;
            while(i < total){
                if (tweeths[i] != 0){
                     tempFeed[lastCursor + i -j] = tweeths[i];
                 }else{
                    j+=1;
                 }
                i+=1;
            }
             profileIndex+=1;
             lastCursor += total - j;
         }
        return tempFeed;

    }

    function isInArray(uint element, uint[] memory _array) internal returns(bool){
        for (uint i=0;i < _array.length;i++){
            if (element == _array[i]){
                return true;
            }
        }return false;
    }


}
